import React from 'react';
import '../assets/styles/all.css';
import '../assets/styles/passwordCheck.css';

const PasswordCheck = () => {
    return(
        <>
            <div className="checkAll">
                <div className="check_password">
                    <h5>비밀번호 입력 :</h5>
                </div>
            </div>
        </>
    )
}

export default PasswordCheck;
